                    $"–ò–Ω–¥–∏–≤–∏–¥—É–∞–ª—å–Ω—ã–π –Ω–æ–º–µ—Ä –∏–≥—Ä–æ–∫–∞ - {_players[i].Id}\n\n");
            }

