    {
        static void Main(string[] args)
        {
            Console.Write("–í–≤–µ–¥–∏—Ç–µ —Å–∫–æ–±–æ—á–Ω–æ–µ –≤—ã—Ä–∞–∂–µ–Ω–∏–µ: ");
            string userInput = Console.ReadLine();
            char[] frames = userInput.ToCharArray();
            int tempDeepFrames = 0;
            int deepFrames = 0;

            if (frames[0] == ')' || frames[frames.Length - 1] == '(' || frames.Length % 2 != 0)
            {
                Console.WriteLine("–ù–µ–≤–µ—Ä–Ω–æ–µ –≤—ã—Ä–∞–∂–µ–Ω–∏–µ");
            }
            else
            {
                foreach (char frame in frames)
                {
                    if (frame == '(')
                    {
                        tempDeepFrames++;

                        if (deepFrames < tempDeepFrames)
                        {
                            deepFrames = tempDeepFrames;
                        }
                    }
                    else
                    {
                        tempDeepFrames--;
                    }

                    if (tempDeepFrames < 0)
