void insert(node** p, Countries countries) // –¥–æ–±–∞–≤–ª–µ–Ω–∏–µ —É–∑–ª–∞ –≤ –¥–µ—Ä–µ–≤–æ –ø–æ–∏—Å–∫–∞
{
    if (*p == NULL)
    { //—Å–æ–∑–¥–∞—ë–º –Ω–æ–≤—ã–π —É–∑–µ–ª –¥–µ—Ä–µ–≤–∞ –Ω–∞ –Ω–∞–π–¥–µ–Ω–Ω–æ–º –º–µ—Å—Ç–µ
        *p = new node;
        (*p)->countries = countries;
        (*p)->left = NULL;
        (*p)->right = NULL;
    }
    else
    {
        if (countries.name < (*p)->countries.name) insert(&(*p)->left, countries);
        if (countries.name > (*p)->countries.name) insert(&(*p)->right, countries);
    }
